modules/vpc/main.tf.code:
resource "aws_vpc" "main" {
  cidr_block       = var.vpc_cidr
  enable_dns_hostnames = true
  enable_dns_support   = true
  tags = {
    Name = "${var.vpc_name}"
  }
}

# Define subnets
resource "aws_subnet" "main" {
  count                   = length(var.subnets_cidr)
  vpc_id                  = aws_vpc.main.id
  cidr_block              = var.subnets_cidr[count.index]
  availability_zone       = element(var.availability_zones, count.index)
  map_public_ip_on_launch = var.map_public_ip_on_launch
  tags = {
    Name = "${var.vpc_name}-subnet-${count.index}"
  }
}

# Internet Gateway for Public Subnets
resource "aws_internet_gateway" "gw" {
  vpc_id = aws_vpc.main.id
  tags = {
    Name = "${var.vpc_name}-gw"
  }
}

# Route Table for Public Subnets
resource "aws_route_table" "public" {
  vpc_id = aws_vpc.main.id
  route {
    cidr_block = "0.0.0.0/0"
    gateway_id = aws_internet_gateway.gw.id
  }
  tags = {
    Name = "${var.vpc_name}-public-rt"
  }
}

resource "aws_route_table_association" "public" {
  count          = length(var.public_subnets_cidr)
  subnet_id      = aws_subnet.main[count.index].id
  route_table_id = aws_route_table.public.id
}

# Adjust the above resources and create additional ones as needed for NAT gateways, private subnets, etc.

modules/vpc/variables.tf.code:
variable "vpc_cidr" {
  description = "The CIDR block for the VPC."
  type        = string
}

variable "vpc_name" {
  description = "The name tag of the VPC and related resources."
  type        = string
}

variable "subnets_cidr" {
  description = "List of CIDR blocks for the subnets within the VPC."
  type        = list(string)
}

variable "availability_zones" {
  description = "List of AZs in which to distribute the subnets."
  type        = list(string)
}

variable "map_public_ip_on_launch" {
  description = "Should the subnet allocate public IPs on launch."
  type        = bool
  default     = false
}

variable "public_subnets_cidr" {
  description = "List of CIDR blocks for the public subnets."
  type        = list(string)
}

